import React from "react";
import './App.css';
import OnboardingBottomArt from './assets/onbordingBottomArt.svg';
import bottomArt from './assets/bottomArt.svg';

function App() {
  return (
    <div className={'dashboard-screen'}>
      hello
      <div className="dashboard-art-holder">
          <img className={'image-width'} src={bottomArt} alt={'art'}/>
      </div>
    </div>
  );
}

export default App;
